The Creative Engagement Group (TCEG) partners with clients to provide employee engagement, learning & training solutions, scientific engagement and capability building, all underpinned by applied behavioural science. We engage internal and external audiences through the creation and delivery of live, hybrid & virtual experiences, film, digital, and immersive content.

Made up of 9 divisions: 

Forty1: Blends insight, technology and creativity to deliver unforgettable employee experiences that drive engagement and business performance;

Axiom: A strategic partner to pharmaceutical and biotech clients for delivering launch excellence, sustained and portfolio market leadership;

Cormis: Provides capability interventions to build the mindset, skills and behaviours for individuals & teams within the pharmaceutical industry;

Logicearth: Partners with clients to build learning services that make a bigger impact in performance and talent development;

WRG: Creates experiences that inspire the lasting change the world needs, across live, virtual and hybrid events and environments;

Ashfield Event Experiences: Specialist healthcare events across the entire product lifecycle;

TCEG Film: Offers award-winning, full service creative and production through our in-house producers, directors, editors, animators, and production managers;

TCEG Digital: Offers full service digital capabilities with our own in-house development, design, strategy and UX expertise;

TCEG Behavioural Science: Provides insight and applied psychology thinking to inform and underpin transformative behaviour change programmes across our range of services.

The Creative Engagement Group is part of Inizio Engage. Inizio is a strategic partner for health and life sciences with a full suite of medical, marketing, advisory and engagement services. For more information, visit www.inizio.health.
